import React, { Component } from 'react'

export default class BackgroundVideo extends Component {
    render() {
        return (
            <video loop autoPlay muted id="bg-video">
                <source src={(require('../assets/Messaoudi.mp4'))}></source>
            </video>
        );
    }
}
